Serviço de verificação da utilização de um novo hardware e software do Console de Gravação e Análise de Vídeo (ConGAV) na gravação e análise de vídeo dos exercícios operativos, utilizando configuração similar ao das Fragatas Classe “Niterói”, atualizada no Projeto Fênix.

ESCOPO DOS  SERVIÇOS
Os serviços a serem executados incluem:

1) Elaboração de documento técnico contendo:
    a) Informações detalhadas do serviço de substituição do ConGAV;
    b) Verificação da viabilidade de uso dos novos hardwares e softwares;
    c) Análise funcional dos sistemas propostos na gravação e análise de vídeo  dos exercícios operativos, utilizando configuração similar à empregada nas  Fragatas Classe “Niterói”;
    d)  Recomendações técnicas sobre a instalação dos novos sistemas no ConGAV atualmente em operação, caso comprovada a aderência aos requisitos funcionais.

REQUISITOS TÉCNICOS
    1) O documento deverá demonstrar que o novo hardware e software são  compatíveis com os requisitos do ConGAV;

    2) Os testes deverão utilizar entradas de vídeo oriundas de sistemas como o RTN 30X, EOS, (canhão de 40 mm) e o SICONTA Mk III;

    3) A análise deverá considerar a arquitetura já validada no Projeto Fênix.

RESPONSABILIDADES DO CONTRATANTE
    1) Disponibilizar acesso às instalações das unidades (COC e Anexo do COC);

    2) Disponibilizar as entradas de vídeo dos sistemas envolvidos (EDTV e SICONTA Mk III);

    3) Acompanhar a execução das verificações “in loco”, quando necessário.

GARANTIA
Os serviços prestados terão garantia de 06 (seis) meses a contar da data de  emissão da nota fiscal, limitada exclusivamente às modificações realizadas  no SGAV.

RESULTADO ESPERADO
Espera-se a entrega de um documento técnico conclusivo sobre a viabilidade  da instalação dos novos sistemas no ConGAV, acompanhado das evidências das verificações realizadas e recomendações técnicas pertinentes.

